import { Injectable } from '@angular/core';
import { CoreContentLinksModuleIndexHandler } from '@features/contentlinks/classes/module-index-handler';
import { makeSingleton } from '@singletons';

/**
 * Handler to treat links to url.
 */
@Injectable({ providedIn: 'root' })
export class AddonModUrlIndexLinkHandlerService extends CoreContentLinksModuleIndexHandler {

    name = 'AddonModUrlLinkHandler';
    useModNameToGetModule = true;

    constructor() {
        super('AddonModUrl', 'url', 'u');
    }

}

export const AddonModUrlIndexLinkHandler = makeSingleton(AddonModUrlIndexLinkHandlerService);
